import { useEffect, useRef, useState } from 'react';
import styled, { css } from 'styled-components';
import Head from './Header';
import About, { Img } from './About';
import Education from './Education';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';
import './styles.css';
import { Autoplay, Pagination, Navigation } from 'swiper/modules';
import 예제이미지 from '../assets/자연3.webp';
import FTT from "../assets/FTT.jpg"
import FTT1 from "../assets/FTT1.jpg"
import FTT2 from "../assets/FTT2.jpg"
import FTT3 from "../assets/FTT3.jpg"
import FTT4 from "../assets/FTT4.jpg"
import 로그인1 from "../assets/로그인1 (1).jpg"
import 로그인2 from "../assets/로그인2.jpg"
import 로그인3 from "../assets/로그인3.jpg"
import 포트폴리1 from "../assets/Port1.jpg"
import 포트폴리2 from "../assets/Port2.jpg"
import 포트폴리3 from "../assets/Port3.jpg"
import 포트폴리4 from "../assets/Port4.jpg"
const Flex = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
`;

const Flexspacebet = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-around;
`;

const Flexcolumn = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    gap: 2rem;
`;

const Div = styled.div`
    text-align: center;
`;

export const Container = styled.div`
    width: 100%;
    height: 100%;
`;

export const H1 = styled.h1`
    font-weight: bold;
    font-size: 40px;
    @media (max-width: 1735px) {
        font-size: 20px;
    }   
`;

export const H2 = styled.h2``;

export const H3 = styled.h3`
    padding-left: 12px;
    font-size: 30px;
    font-weight: bold;
    @media (max-width: 1735px) {
        font-size: 15px;
    }   
`;

export const H4 = styled.h4`
    font-size: 24px;
    font-weight: 300;
    @media (max-width: 1735px) {
        font-size: 12px;
    }   
`;

export const H5 = styled.h5`
    font-size: 16px;
    font-weight: bold;
    @media (max-width: 1735px) {
        font-size: 8px;
    }   
`;

export const P = styled.p`
    font-size: 28px;
    @media (max-width: 1735px) {
        font-size: 14px;
    }   
`;

export const Smallp = styled.p`
    font-size: 24px;
    color: white;
    @media (max-width: 1735px) {
        font-size: 12px;
    }   
`; 

const Alink = styled.a``;

const Portfolio = styled.div`
    width: 100%;
    height: 100%;
    background-color: dodgerblue;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    gap: 32px;
`;

const PortfolioTob = styled.div`
    width: 100%;
    max-width: 1614px;
    height: 112px;
    margin: 0 auto;
    display: flex;
    align-items: center;
    border-bottom: 1px solid black;
`;

const PortfolioBottom = styled.div`
    width: 100%;
    max-width: 1614px;
    height: 112px;
    margin: 0 auto;
    display: flex;
    justify-content: end;
    align-items: center;
    padding-right: 12px;
    border-top: 1px solid black;
`;

const Portfoliocontent = styled.div`
    width: 100%;
    max-width: 1440px;
    height: 600px;
    background-color: yellowgreen;
    margin: 0 auto;
    display: flex;
`;

const Portfolioleft = styled.div`
    width: 50%;
    height: 100%;
    background-color: yellow;
    padding: 1rem;
`;

const Portfolioright = styled.div`
    width: 100%;
    height: 100%;
    background-color: pink;
    display: flex;
    justify-content: center;
`;

const Rightcontent = styled.div`
    width: 513px;
    height: 100%;
    background-color: khaki;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
`;

export const Portfoliop = styled.p`
    font-size: 16px;
    @media (max-width: 1735px) {
        font-size: 8px;
    }   
`;

const Pborder = styled.p`
    font-size: 16px;
    border-bottom: 1px solid black;
    padding: 0 0 2rem 0;
    @media (max-width: 1735px) {
        font-size: 8px;
    }   
`;

const swiperimg = [
    [로그인1, 로그인2, 로그인3],
    [FTT, FTT1, FTT2, FTT3, FTT4],
    [포트폴리1, 포트폴리2, 포트폴리3, 포트폴리4]
];

const palce = ["Buddiz","FTT","Portfolio","로미지안 사이트", "애경 사이트"];
const palce1 = ["/Team","/Team","/Solo","/Solo", "/Solo"];
const palce2 = ["배포","github","개발담당","stack"];
const palce3 = ["https://junjunhee12.github.io/Buddiz/","https://jeonsunam.github.io/Project1_FTT/","https://vercel.com/junjunhee12s-projects/myportfolio","https://mywebsite-chi-murex.vercel.app/","https://aekyung-publishing.vercel.app/"];

function Home() {
    const progressCircle = useRef(null);
    const progressContent = useRef(null);

    const onAutoplayTimeLeft = (s, time, progress) => {
        progressCircle.current.style.setProperty('--progress', 1 - progress);
        progressContent.current.textContent = `${Math.ceil(time / 1000)}s`;
    };

    return (
        <Container>
            <Head />
            <About />
            <Education />
            <Portfolio>
                <PortfolioTob><H3>Portfolio &gt;</H3></PortfolioTob>
                {palce.map((text, index) => (
                    <Portfoliocontent key={index}>
                        <Portfolioleft>
                            <Swiper
                                spaceBetween={30}
                                centeredSlides={true}
                                autoplay={{
                                    delay: 2500,
                                    disableOnInteraction: false,
                                }}
                                pagination={{
                                    clickable: true,
                                }}
                                navigation={true}
                                modules={[Autoplay, Pagination, Navigation]}
                                onAutoplayTimeLeft={onAutoplayTimeLeft}
                                className="mySwiper"
                            >
                                {swiperimg[index].map((image, imgIndex) => (
                                    <SwiperSlide key={imgIndex}>
                                        <Img src={image} alt={`Slide ${imgIndex + 1}`} />
                                    </SwiperSlide>
                                ))}
                                <div className="autoplay-progress" slot="container-end">
                                    <svg viewBox="0 0 48 48" ref={progressCircle}>
                                        <circle cx="24" cy="24" r="20"></circle>
                                    </svg>
                                    <span ref={progressContent}></span>
                                </div>
                            </Swiper>
                        </Portfolioleft>
                        <Portfolioright>
                            <Rightcontent>
                                <Div>
                                    <Flex>
                                        <H3>{text}</H3>
                                        <H4>{palce1[index]}</H4>
                                    </Flex>
                                    <Div>
                                        <Portfoliop>2020.02.05</Portfoliop>
                                    </Div>
                                </Div>
                                <Flex>
